path.style:
width: 9px;
    height: 9px;
    padding-top: 2px;
    padding-bottom: 2px;
    padding-left: 2px;
    padding-right: 2px;
    background-color: #FFFFFF;
    background-repeat: repeat;
    background-position-x: left;
    background-position-y: top;
    background-attachment: scroll;
    background-size: auto;
    background-image: none;
    stroke-width: 4px;
    stroke: #DDDDDD;
    box-shadow: none;
    fill: rgba(0, 0, 0, 0);
